import datetime
import logging
from enum import Enum, auto
from typing import List, Dict, Optional

# Enums
class SubmissionStatus(Enum):
    DRAFT = auto()
    VALIDATED = auto()
    PUBLISHED = auto()
    ERROR = auto()

# Models
class Submission:
    def __init__(self, submission_id: str, user_id: str):
        self.submission_id = submission_id
        self.user_id = user_id
        self.files = []
        self.status = SubmissionStatus.DRAFT
        self.created_at = datetime.datetime.now()
        self.updated_at = self.created_at
        self.validation_errors = []

    def add_file(self, file_path: str) -> bool:
        self.files.append(file_path)
        self.updated_at = datetime.datetime.now()
        return True

    def validate(self, validation_rules: Dict) -> bool:
        try:
            # Simulate validation logic
            if not self.files:
                raise ValueError("No files uploaded")
            for rule in validation_rules.get('rules', []):
                # Apply validation rules (sample logic)
                if rule == 'file_format' and not all(f.endswith('.csv') for f in self.files):
                    raise ValueError("Invalid file format. Only CSV files are allowed.")
            self.status = SubmissionStatus.VALIDATED
            return True
        except Exception as e:
            self.status = SubmissionStatus.ERROR
            self.validation_errors.append(str(e))
            return False

    def publish(self) -> bool:
        if self.status != SubmissionStatus.VALIDATED:
            self.status = SubmissionStatus.ERROR
            self.validation_errors.append("Cannot publish: Submission not validated")
            return False
        self.status = SubmissionStatus.PUBLISHED
        self.updated_at = datetime.datetime.now()
        return True

class User:
    def __init__(self, user_id: str, role: str):
        self.user_id = user_id
        self.role = role

class Test:
    def __init__(self, test_id: str, participants: List[str], test_date: datetime.datetime):
        self.test_id = test_id
        self.participants = participants
        self.test_date = test_date
        self.results = {}

    def add_result(self, participant_id: str, feedback: str) -> None:
        self.results[participant_id] = feedback

    def generate_report(self) -> Dict:
        return {
            'test_id': self.test_id,
            'participants': len(self.participants),
            'feedback': self.results,
            'test_date': self.test_date
        }

class ValidationRule:
    def __init__(self, rule_id: str, condition: str, description: str):
        self.rule_id = rule_id
        self.condition = condition
        self.description = description

# Services
class SubmissionService:
    def __init__(self):
        self.submissions = {}
        self.logger = logging.getLogger(__name__)

    def create_submission(self, user_id: str) -> Submission:
        submission_id = f"sub_{datetime.datetime.now().timestamp()}"
        submission = Submission(submission_id, user_id)
        self.submissions[submission_id] = submission
        self.logger.info(f"Created submission {submission_id} for user {user_id}")
        return submission

    def upload_file(self, submission_id: str, file_path: str) -> bool:
        if submission_id not in self.submissions:
            self.logger.error(f"Submission {submission_id} not found")
            return False
        return self.submissions[submission_id].add_file(file_path)

    def validate_submission(self, submission_id: str, validation_rules: Dict) -> bool:
        if submission_id not in self.submissions:
            self.logger.error(f"Submission {submission_id} not found")
            return False
        return self.submissions[submission_id].validate(validation_rules)

    def publish_submission(self, submission_id: str) -> bool:
        if submission_id not in self.submissions:
            self.logger.error(f"Submission {submission_id} not found")
            return False
        return self.submissions[submission_id].publish()

    def get_submission_status(self, submission_id: str) -> Optional[SubmissionStatus]:
        if submission_id not in self.submissions:
            self.logger.error(f"Submission {submission_id} not found")
            return None
        return self.submissions[submission_id].status

class TestService:
    def __init__(self):
        self.tests = {}

    def schedule_test(self, test_id: str, participants: List[str], test_date: datetime.datetime) -> Test:
        test = Test(test_id, participants, test_date)
        self.tests[test_id] = test
        return test

    def add_test_feedback(self, test_id: str, participant_id: str, feedback: str) -> bool:
        if test_id not in self.tests:
            return False
        self.tests[test_id].add_result(participant_id, feedback)
        return True

    def generate_test_report(self, test_id: str) -> Optional[Dict]:
        if test_id not in self.tests:
            return None
        return self.tests[test_id].generate_report()

class ValidationService:
    def __init__(self):
        self.rules = {}

    def add_rule(self, rule: ValidationRule) -> None:
        self.rules[rule.rule_id] = rule

    def remove_rule(self, rule_id: str) -> bool:
        if rule_id in self.rules:
            del self.rules[rule_id]
            return True
        return False

    def get_rules(self) -> Dict:
        return {k: v.__dict__ for k, v in self.rules.items()}

