if __name__ == "__main__":
    logging.basicConfig(level=logging.INFO)

    # Initialize services
    submission_service = SubmissionService()
    test_service = TestService()
    validation_service = ValidationService()

    # User creates a submission
    user = User("user1", "submitter")
    submission = submission_service.create_submission(user.user_id)

    # User uploads a file
    submission_service.upload_file(submission.submission_id, "data.csv")

    # Validator adds rules
    validation_service.add_rule(ValidationRule("rule1", "file_format", "File must be CSV"))

    # Validate submission
    submission_service.validate_submission(submission.submission_id, {'rules': ['file_format']})

    # Publish submission
    submission_service.publish_submission(submission.submission_id)

    # Schedule a test
    test_service.schedule_test("test1", ["tester1", "tester2"], datetime.datetime.now() + datetime.timedelta(days=7))

    # Generate test report
    test_service.add_test_feedback("test1", "tester1", "Everything works fine!")
    report = test_service.generate_test_report("test1")
    print(report)

    # List published files
